erenceSources` parameter)","example": ["http://purl.obolibrary.org/obo/ro.owl","14a19841"],"items": {"type": "string"}},"externalReferenceSources": {"type": "array","description": "List of identifiers for the source system or database of an external reference (use with `externalReferenceIDs` parameter)","example": ["OBO Library","Field App Name"],"items": {"type": "string"}},"germplasmPUIs": {"description": "List of Permanent Unique Identifiers to identify germplasm","items": {"type": "string"},"type": "array","nullable": true,"example": ["http://pui.per/accession/A0000003","http://pui.per/accession/A0000477"]},"accessionNumbers": {"description": "A collection of unique identifiers for materials or germplasm within a genebank

